//5.	Print Series 1  11  111  111……..n terms

package AssigmentOnLooping;

public class PrintSeries {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int i = 1; i <= 5; i++) {	
			for (int j = 1; j <= i; j++) {
				System.out.print(1);
			}
			System.out.print(" ");
		}
	}
}
